import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Document, Page } from 'react-pdf';
import { ZoomIn, ZoomOut, Download, Share2, Bookmark, ChevronLeft, ChevronRight } from 'lucide-react';
import DashboardLayout from '../components/layout/DashboardLayout';

const DocumentViewer = () => {
  const [numPages, setNumPages] = useState(null);
  const [pageNumber, setPageNumber] = useState(1);
  const [scale, setScale] = useState(1.0);

  const onDocumentLoadSuccess = ({ numPages }) => {
    setNumPages(numPages);
  };

  const changePage = (offset) => {
    setPageNumber(prevPageNumber => {
      const newPageNumber = prevPageNumber + offset;
      return Math.min(Math.max(1, newPageNumber), numPages);
    });
  };

  const zoomIn = () => {
    setScale(prevScale => Math.min(prevScale + 0.1, 2.0));
  };

  const zoomOut = () => {
    setScale(prevScale => Math.max(prevScale - 0.1, 0.5));
  };

  return (
    <DashboardLayout>
      <div className="p-6 max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
          className="mb-8"
        >
          <h1 className="text-3xl font-bold text-gray-900 mb-2">Document Viewer</h1>
          <p className="text-gray-600">View and interact with your legal documents</p>
        </motion.div>

        <div className="bg-white rounded-xl shadow-sm overflow-hidden">
          {/* Document Controls */}
          <div className="border-b border-gray-200 p-4">
            <div className="flex items-center justify-between">
              <div className="flex items-center space-x-4">
                <button
                  onClick={() => changePage(-1)}
                  disabled={pageNumber <= 1}
                  className="p-2 rounded-lg hover:bg-gray-100 disabled:opacity-50 disabled:cursor-not-allowed"
                >
                  <ChevronLeft className="w-5 h-5 text-gray-600" />
                </button>
                <span className="text-gray-600">
                  Page {pageNumber} of {numPages || '--'}
                </span>
                <button
                  onClick={() => changePage(1)}
                  disabled={pageNumber >= numPages}
                  className="p-2 rounded-lg hover:bg-gray-100 disabled:opacity-50 disabled:cursor-not-allowed"
                >
                  <ChevronRight className="w-5 h-5 text-gray-600" />
                </button>
              </div>

              <div className="flex items-center space-x-2">
                <button
                  onClick={zoomOut}
                  className="p-2 rounded-lg hover:bg-gray-100"
                >
                  <ZoomOut className="w-5 h-5 text-gray-600" />
                </button>
                <span className="text-gray-600">{Math.round(scale * 100)}%</span>
                <button
                  onClick={zoomIn}
                  className="p-2 rounded-lg hover:bg-gray-100"
                >
                  <ZoomIn className="w-5 h-5 text-gray-600" />
                </button>
              </div>

              <div className="flex items-center space-x-2">
                <button className="p-2 rounded-lg hover:bg-gray-100">
                  <Download className="w-5 h-5 text-gray-600" />
                </button>
                <button className="p-2 rounded-lg hover:bg-gray-100">
                  <Share2 className="w-5 h-5 text-gray-600" />
                </button>
                <button className="p-2 rounded-lg hover:bg-gray-100">
                  <Bookmark className="w-5 h-5 text-gray-600" />
                </button>
              </div>
            </div>
          </div>

          {/* Document View */}
          <div className="p-6 bg-gray-50 min-h-[calc(100vh-300px)] flex items-center justify-center">
            <div className="bg-white shadow-lg rounded-lg overflow-hidden">
              <Document
                file="/sample.pdf"
                onLoadSuccess={onDocumentLoadSuccess}
                className="flex items-center justify-center"
              >
                <Page
                  pageNumber={pageNumber}
                  scale={scale}
                  renderTextLayer={false}
                  renderAnnotationLayer={false}
                  className="max-w-full"
                />
              </Document>
            </div>
          </div>
        </div>

        {/* Document Info */}
        <div className="mt-6 bg-white rounded-xl shadow-sm p-6">
          <h2 className="text-xl font-semibold text-gray-900 mb-4">Document Information</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
            <div>
              <h3 className="text-sm font-medium text-gray-500 mb-1">Title</h3>
              <p className="text-gray-900">Sample Legal Document</p>
            </div>
            <div>
              <h3 className="text-sm font-medium text-gray-500 mb-1">Type</h3>
              <p className="text-gray-900">Contract Agreement</p>
            </div>
            <div>
              <h3 className="text-sm font-medium text-gray-500 mb-1">Last Modified</h3>
              <p className="text-gray-900">March 15, 2024</p>
            </div>
            <div>
              <h3 className="text-sm font-medium text-gray-500 mb-1">Size</h3>
              <p className="text-gray-900">2.4 MB</p>
            </div>
            <div>
              <h3 className="text-sm font-medium text-gray-500 mb-1">Pages</h3>
              <p className="text-gray-900">{numPages || '--'} pages</p>
            </div>
            <div>
              <h3 className="text-sm font-medium text-gray-500 mb-1">Status</h3>
              <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-green-100 text-green-800">
                Active
              </span>
            </div>
          </div>
        </div>
      </div>
    </DashboardLayout>
  );
};

export default DocumentViewer;
